import React from "react";
import "./signin.css";
import workoutImage from "./image 1.png"; // Replace with the actual image path

const SignIn = () => {
  return (
    <div class="flex flex-col md:flex-row h-screen bg-gradient-to-r from-blue-900 to-orange-500">
    <div class="hidden md:block w-1/2 relative">
    <img src="https://placehold.co/400x400" alt="Workout Image" class="absolute inset-0 w-full h-full object-cover rounded-l-lg" />
  </div>
  <div class="flex flex-col justify-center items-center w-full md:w-1/2 p-8 bg-white rounded-lg shadow-lg">
    <h1 class="text-2xl font-bold mb-6">SIGN IN</h1>
    <input type="email" placeholder="Email" class="border border-zinc-300 p-2 rounded mb-4 w-full" />
    <input type="password" placeholder="Password" class="border border-zinc-300 p-2 rounded mb-4 w-full" />
    <button class="bg-orange-500 text-white p-2 rounded w-full hover:bg-orange-400">SIGN IN</button>
    <div class="my-4 text-center">
      <span class="text-zinc-500">or</span>
      <button class="flex items-center justify-center border border-zinc-300 p-2 rounded mt-2 w-full">
        <img src="https://openui.fly.dev/openui/20x20.svg?text=G" alt="Google Logo" class="mr-2" />
        sign in with Google
      </button>
    </div>
    <div class="text-sm text-zinc-500">
      <a href="#" class="hover:underline">create an account?</a> |
      <a href="#" class="hover:underline">forgot password?</a>
    </div>
  </div>
</div>
  );
};

export default SignIn;
